import { createContext } from "react"

export const ThemeContext = createContext();

export function ThemeContextProvider({children}) {
    return(
    <ThemeContext.Provider value={ {color:'success', btncolor:'warning' }}>
        {children}
    </ThemeContext.Provider>
    )
}
